import './App.css';

function App() {
  return (
    <div className="App">
      <div className="App-header">
        <div className="card">
          <div className="title">
            To do list
          </div>
          <div>
            <input></input>
          </div>
        </div>
      </div>
    </div>
  );
}

export default App;
